INSERT INTO `filme` VALUES (1,'Harry Potter e a Pedra Filosofal','Harry Potter and the Philosopher\'s Stone','2001',17,18,11,12,'Harry Potter é um garoto órfão de 10 anos que vive infeliz com seus tios, os Dursley. Até que, repentinamente, ele recebe uma carta contendo um convite para ingressar em Hogwarts, uma famosa escola especializada em formar jovens bruxos. Inicialmente Harry é impedido de ler a carta por seu tio Válter, mas logo ele recebe a visita de Hagrid,o guarda-caça de Hogwarts, que vai levá-lo até a escola.','2:22',1,1,'data:image/jpeg;base64,'),(2,'O Senhor dos Anéis: A Sociedade do Anel','The Lord of the Rings: The Fellowship of the Ring','2001',38,43,26,3,'Um hobbit recebe de presente de seu tio um anel mágico e maligno que precisa ser destruído antes que caia nas mãos do mal, pois o futuro da civilização depende do destino desse anel. Para isso, o hobbit Frodo terá um caminho árduo pela frente. Ao seu lado, para o cumprimento desta jornada, ele poderá contar com outros hobbits.','2:45',1,1,'data:image/jpeg;base64,'),(3,'Harry Potter e a Câmara Secreta','Harry Potter and The Chamber of Secrets','2002',17,18,11,12,'De férias na casa de seus tios Dursley, Harry Potter recebe a inesperada visita de Dobby, um elfo doméstico, que veio avisá-lo para não retornar à Escola de Magia de Hogwarts, pois lá correrá um grande perigo. Harry não lhe dá ouvidos e decide retornar aos estudos, enfrentando um 2º ano recheado de novidades. Uma delas é a contratação do novo Professor de Defesa Contra as Artes das Trevas.','2:30',1,1,'data:image/jpeg;base64,'),(4,'O Senhor dos Anéis: As Duas Torres','The Lord of the Rings: The Two Towers','2002',38,43,26,3,'Após a captura de Merry (Dominic Monaghan) e Pippy (Billy Boyd) pelos orcs, a Sociedade do Anel é dissolvida. Enquanto que Frodo (Elijah Wood) e Sam (Sean Astin) seguem sua jornada rumo à Montanha da Perdição para destruir o Um Anel, Aragorn (Viggo Mortensen), Legolas (Orlando Bloom) e Gimli (John Rhys-Davies) partem para resgatar os hobbits sequestrados.','2:58',1,1,'data:image/jpeg;base64,');
INSERT INTO `filme` VALUES (5,'Anjos da Noite','Underworld','2004',38,43,27,12,'Na calada da noite, vampiros se envolvem em uma batalha antiga com seus inimigos, os Lycans, um grupo de lobisomens violentos. Selene, uma vampira que é órfã por conta de um ataque dos Lycan, trabalha para o clã dos vampiros como uma matadora treinada. Quando os Lycan se interessam misteriosamente por Michael Corvin, um doutor mortal excepcional, Selene luta para livrá-lo de Lucian, um cruel Lycan','2:01',1,1,'data:image/jpeg;base64,'),(6,'Matrix Reloaded','The Matrix Reloaded','2003',38,43,11,14,'Os combatentes da liberdade Neo, Trinity e Morpheus continuam a liderar a revolta contra o Exército das Máquinas, desencadeando seu arsenal de habilidades extraordinárias e armamentos contra as forças sistemáticas de repressão e exploração. Em sua busca para salvar a raça humana da extinção, eles ganham um maior conhecimento sobre a construção do Matrix e o papel de Neo no destino da humanidade.','2:18',1,1,'data:image/jpeg;base64,'),(7,'Matrix Revolutions','The Matrix Revolutions','2003',38,43,11,14,'Em uma distopia invadida por robôs, Neo, a maior esperança da humanidade, está preso entre a Matrix e a realidade. A maioria da população do planeta permanece num estado de suspensão da realidade virtual. Os poucos humanos que estão cientes das duras realidades tentam desesperadamente afastar as máquinas a tempo de Neo escapar e salvar o dia.','2:09',1,1,'data:image/jpeg;base64,'),(8,'O Senhor dos Anéis: O Retorno do Rei','The Lord of the Rings: The Return of the King','2003',38,43,11,3,'Sauron planeja um grande ataque a Minas Tirith, capital de Gondor, o que faz com que Gandalf (Ian McKellen) e Pippin (Billy Boyd) partam para o local na intenção de ajudar a resistência. Um exército é reunido por Theoden (Bernard Hill) em Rohan, em mais uma tentativa de deter as forças de Sauron. Enquanto isso Frodo (Elijah Wood), Sam (Sean Astin) e Gollum (Andy Serkins) seguem sua viagem rumo à M','3:20',1,1,'data:image/jpeg;base64,'),(9,'Crash - no limite','Crash','2005',38,43,28,10,'Tensões raciais emergem em uma série de histórias envolvendo moradores de Los Angeles. Diversos personagens das mais variadas origens étnicas se cruzam em um incidente. Os diferentes estereótipos que a sociedade criou para esses grupos raciais afeta seu julgamento, crenças e atitudes, o que causa problemas e tensões para todos.','1:55',0,1,'data:image/jpeg;base64,'),(10,'Harry Potter e o Prisioneiro de Azkaban','Harry Potter and the Prisoner of Azkaban','2004',17,18,11,12,'O terceiro ano de Harry Potter em Hogwarts começa mal quando ele descobre que o assassino Sirius Black escapou da prisão de Azkaban e está empenhado em matá-lo. Enquanto o gato de Hermione atormenta o rato doente de Ron, um bando de dementadores são enviados para proteger a escola de Sirius Black. Um professor misterioso ajuda Harry a aprender a se defender.','2:20',1,1,'data:image/jpeg;base64,'),(11,'A Fantástica Fábrica de Chocolate','Charlie and the Chocolate Factory','2005',38,43,11,12,'Baseado no conto de Roald Dahl, este cômico e fantástico filme segue o jovem Charlie Bucket e seu avô Joe. Eles se juntam a um pequeno grupo de ganhadores de uma competição, os quais vão para um passeio na mágica e misteriosa fábrica do excêntrico Willy Wonka. Ajudado por seus anões trabalhadores, Wonka esconde uma surpresa para durante o passeio.','1:55',1,1,'data:image/jpeg;base64,'),(12,'Harry Potter e o Cálice de Fogo','Harry Potter and the Goblet of Fire','2005',17,18,11,12,'Harry retorna para seu quarto ano na Escola de Magia e Bruxaria de Hogwarts, junto com os seus amigos Rony e Hermione. Desta vez, acontece um torneio entre as três maiores escola de magia, com um participante selecionado de cada escola pelo Cálice de Fogo. O nome de Harry aparece, mesmo não tendo se inscrito, e ele precisa competir.','2:35',1,1,'data:image/jpeg;base64,'),(13,'Sin City - A Cidade do Pecado','Sin City','2005',38,43,14,17,'Nestes contos noir, um misterioso vendedor narra a trágica história de co-dependência enquanto um vigilante mergulha no submundo à procura de seu amor perdido. Em outra parte da cidade, um policial persegue um assassino de crianças e uma ex-prostituta escapa de seu cafetão com a ajuda do novo namorado','2:27',0,1,'data:image/jpeg;base64,'),(14,'Anjos da Noite: A Evolução','Underworld: Evolution','2006',38,43,7,12,'Selene, uma sedutora vampira, e o renegado lobisomem Michael se amam, mas são incompreendidos por suas próprias raças. Buscando pistas para encontrar uma saída, eles são perseguidos por Marcus, uma criatura antiga e obcecada com a perpetuação da guerra entre eles. Continuamente perseguidos por inimigos de ambos os lados, os amantes exploram seu passado enquanto procuram o seu destino.','1:46',1,1,'data:image/jpeg;base64,'),(15,'Harry Potter e a Ordem da Fênix','Harry Potter and the Order of the Phoenix','2007',17,18,11,12,'Harry está em seu quinto ano em Hogwarts. Ele acaba ouvindo que muitos não sabem a verdade sobre seu encontro com Lord Voldermort. O Ministro de Mágica, Cornelius Fudge, indica Dolores Umbridge para ser a nova professora de Defesa contra as Artes Negras, por acreditar que Dumbledore planeja tomar seu lugar. Porém, os métodos que ela usa são totalmente inapropriados.','2:18',1,1,'data:image/jpeg;base64,');
INSERT INTO `filme` VALUES (16,'Anjos da Noite: A Rebelião','Underworld : Rise of the Lycans','2009',38,43,6,12,'Viktor, o cruel rei dos vampiros, tem perseguido e escravizado os lycans, uma linhagem de lobisomens nascidos humanos, por séculos. Este tirano ancião exige prata dos nobres, com o propósito de manter o controle dos seus escravos bestiais. Enquanto cresce, o jovem Lucian se apaixona pela filha de Viktor, Sonja, uma vampira insubordinada e imprudente.','1:32',1,1,'data:image/jpeg;base64,'),(17,'Gamer','Gamer','2009',38,43,28,1,'Em uma época futura, a tecnologia de controle da mente toma conta do mundo. Jovens internautas se divertem com um revolucionário videogame online, que controla a mente de condenados à morte como se fossem peças de um jogo. Se um prisioneiro consegue vencer o jogo por trinta vezes, ele é perdoado.','1:35',0,1,'data:image/jpeg;base64,'),(18,'Harry Potter e o Enigma do Príncipe','Harry Potter and the Half-Blood Prince','2009',17,18,11,12,'Os Comensais da Morte estão empolgados com a volta do Voldemort e atacam o mundo dos trouxas e dos bruxos. Dumbledore chama seu amigo Horácio Slughorn para ajudá-lo na preparação de Harry Potter. Harry se vê cada vez mais interessado em Gina e Hermonie morre de ciúmes de Ron, mas prefere não dizer nada.','2:32',1,1,'data:image/jpeg;base64,'),(19,'Harry Potter e as Relíquias da Morte: Part1','Harry Potter and the Deathly Hallows - Part 1','2010',17,18,11,12,'Sem a orientação e a proteção de seus professores, Harry, Rony e Hermione começam uma missão para destruir as Horcruxes, que são fontes da imortalidade de Voldemort. Mais do que nunca, eles dependem uns dos outros, mas forças obscuras ameaçam separá-los.','2:27',1,1,'data:image/jpeg;base64,'),(20,'Harry Potter e as Relíquias da Morte: Part2','Harry Potter and the Deathly Hallows - Part 2','2011',17,18,11,12,'Harry Potter terá que fazer um sacrifício final conforme o confronto com Lord Voldermort se aproxima.','2:10',1,1,'data:image/jpeg;base64,');
INSERT INTO `filme` VALUES (21,'Contágio','Contagion','2011',38,43,11,14,'Contágio segue o rápido progresso de um vírus letal, transmissível pelo ar, que mata em poucos dias. Como a epidemia se espalha rapidamente, a comunidade médica mundial inicia uma corrida para encontrar a cura e controlar o pânico que se espalha mais rápido do que o próprio vírus. Ao mesmo tempo, pessoas comuns lutam para sobreviver em uma sociedade que está desmoronando.','1:46',0,1,'data:image/jpeg;base64,'),(22,'Thor','Thor','2011',38,43,2,1,'Thor (Chris Hemsworth) estava prestes a receber o comando de Asgard das mãos de seu pai Odin (Anthony Hopkins) quando forças inimigas quebraram um acordo de paz. Disposto a se vingar do ocorrido, o jovem guerreiro desobedece as ordens do rei e quase dá início a uma nova guerra entre os reinos. Enfurecido com a atitude do filho e herdeiro, Odin retira seus poderes e o expulsa para a Terra.','1:54',1,1,'data:image/jpeg;base64,'),(23,'Anjo da Noite O Despertar','Underworld: Awakening','2012',38,43,6,12,'Após acordar de um coma de mais de 10 anos, Selene vê que o mundo mudou muito desde que \"apagou\". Os humanos descobriram a existência dos vampiros e lobisomens e passaram a caçar essas raças. No meio da enterna disputa, descobre que possui uma filha adolescente que é metade vampira e metade lobisomem, que precisará de sua ajuda.','1:30',1,1,'data:image/jpeg;base64,'),(24,'O Hobbit: Uma Jornada Inesperada','The Hobbit: An Unexpected Journey','2012',38,43,11,12,'Bilbo Bolseiro (Martin Freeman) vive uma vida pacata no condado, como a maioria dos hobbits. Um dia, aparece em sua porta o mago Gandalf, o cinzento (Ian McKellen), que lhe promete uma aventura como nunca antes vista. Na companhia de vários anões, Bilbo e Gandalf iniciam sua jornada inesperada pela Terra Média.','2:49',1,1,'data:image/jpeg;base64,'),(25,'300 - A Ascensão do Império','300 - Rise Of An Empire','2014',38,43,11,1,'Após a morte do pai, Xerxes (Rodrigo Santoro) dá início a uma jornada de vingança e ruma em direção à Grécia, com seu exército sendo liderado por Artemisia (Eva Green). Enquanto os 300 espartanos liderados por Leonidas tantam combater o Deus-Rei, os exércitos do resto da Grécia se unem para uma batalha com as tropas de Artemisia no mar.','1:42',0,1,'data:image/jpeg;base64,'),(26,'O Hobbit: A Desolação de Smaug','The Hobbit: The Desolation of Smaug','2014',38,43,11,12,'Após iniciar sua jornada ao lado de um grupo de anões e de Gandalf (Ian McKellen), Bilbo Bolseiro (Martin Freeman) segue em direção à Montanha Solitária, onde deverá ajudar seus companheiros de missão a retomar a Pedra de Arken, que fará com que Thorin  (Richard Armitage) obtenha o respeito de todos os anões e o apoio na luta para retomar seu reino.','2:41',0,1,'data:image/jpeg;base64,'),(27,'The Device','The Device','2014',38,43,28,14,'Duas irmãs descobrem uma esfera negra no bosque perto da casa da família. Elas ainda não sabem mas o objeto é a chave para um mistério que irá mudar o destino da humanidade.','1:30',0,1,'data:image/jpeg;base64,'),(28,'Insurgente','Insurgent','2015',38,43,29,14,'Tris (Shailene Woodley) e Quatro (Theo James) agora são fugitivos e procurados por Jeanine Matthews (Kate Winslet), líder da Erudição. Em busca de respostas e assombrados por prévias escolhas, o casal enfrentará inimagináveis desafios enquanto tentam descobrir a verdade sobre o mundo em que vivem.','1:59',1,1,'data:image/jpeg;base64,'),(29,'O Ultimo Golpe','American Heist','2014',6,7,30,1,'Lutando para mudar sua vida, James consegue um trabalho mecânico e logo conhece uma bela mulher. Ao mesmo tempo, seu irmão, Frankie, deixa a prisão e tenta se reconectar com a família. Sem conseguir progredir nos negócios, James irá se juntar ao irmão num último e audacioso trabalho.','1:35',0,1,'data:image/jpeg;base64,'),(30,'Cinquenta Tons de Cinza','Fifty Shades of Grey','2015',38,43,10,18,'Quando a estudante de literatura Anastasia Steele, de 21 anos, entrevista o jovem bilionário Christian Grey, como um favor a sua colega de quarto Kate Kavanagh, descobre nele um homem atraente e brilhante. Embora seja sexualmente inexperiente, ela mergulha de cabeça nesta relação e descobre os prazeres do sadomasoquismo, tornando-se o objeto de submissão do sádico Grey.','2:05',1,1,'data:image/jpeg;base64,'),(31,'Homem Formiga','Ant-Man','2015',38,43,14,1,'Dr. Hank Pym (Michael Douglas), o inventor da fórmula/ traje que permite o encolhimento, anos depois da descoberta, precisa impedir que seu ex-pupilo Darren Cross (Corey Stoll), consiga replicar o feito e vender a tecnologia para uma organização do mal. Depois de sair da cadeia, o trambiqueiro Scott Lang está disposto a reconquistar o respeito da ex-mulher, Maggie e principalmente, da filha.','1:57',1,1,'data:image/jpeg;base64,');
INSERT INTO `filme` VALUES (32,'Kingsman - Serviço Secreto','Kingsman: The Secret Service','2015',17,18,25,1,'Eggsy (Taron Egerton) é um jovem com problemas de disciplina que parece perto de se tornar um criminoso. Determinado dia, ele entra em contato com Harry (Colin Firth), que lhe apresenta à agência de espionagem Kingsman. O jovem se une a um time de recrutas em busca de uma vaga na agência.Ao mesmo tempo, Harry tenta impedir a ascensão do vilão Valentine (Samuel L. Jackson).','2:09',0,1,'data:image/jpeg;base64,'),(33,'Quarteto Fantástico','The Fantastic Four','2015',38,43,25,1,'Quatro adolescentes são conhecidos pela inteligência e pelas dificuldades de inserção social. Juntos, são enviados a uma missão perigosa em uma dimensão alternativa. Quando os planos falham, eles retornam à Terra com sérias alterações corporais. Munidos desses poderes especiais, eles se tornam o Senhor Fantástico, a Mulher Invisível, o Tocha Humana e e o Coisa.','1:41',1,1,'data:image/jpeg;base64,'),(34,'Vingadores: Era de Ultron','The Avengers: Age of Ultron','2015',38,43,14,1,'Tentanto proteger o planeta de ameaças como as vistas no primeiro Os Vingadores, Tony Stark busca construir um sistema de inteligência artifical que cuidaria da paz mundial. O projeto acaba dando errado e gera o nascimento do Ultron (voz de James Spader).','2:21',1,1,'data:image/jpeg;base64,'),(35,'Uma Noite de Crime 3','The Purge: Election Year','2016',38,43,10,19,'O policial Barnes (Frank Grillo) agora é o principal responsável pela segurança da senadora Charlene Roan (Elizabeth Mitchell), que planeja acabar de uma vez por todas a noite de crime. Em plena época de eleições, ela é uma das melhores posicionadas nas pesquisas e nova inimiga número um dos criminosos, que se armam para eliminá-la de qualquer jeito.','1:49',0,1,'data:image/jpeg;base64,');
/*!40000 ALTER TABLE `filme` ENABLE KEYS */;
